# Definition for singly-linked list.
# class ListNode(object):
#     def __init__(self, x):
#         self.val = x
#         self.next = None

class Solution(object):
	def reorderList(self, head):
		"""
		:type head: ListNode
		:rtype: void Do not return anything, modify head in-place instead.
		"""
		nodes = []
		p = head
		while p is not None:
			nodes.append(p)
			p = p.next

		if len(nodes) <= 2:
			return

		i, j = 0, len(nodes)-1
		while True:
			if i+1 < j:
				nodes[i].next = nodes[j]
				nodes[j].next = nodes[i+1]
				i, j = i+1, j-1
			elif i + 1 == j:
				nodes[i].next = nodes[j]
				nodes[j].next = None
				break
			elif i == j:
				nodes[i].next = None
				break

		return




